export default {
  data: function data() {
    return {
      seedWord: [],
      seedIndex: {},
      showSeed: [],
      showSeed1: [],
      checkPromp: ""
    };
  },
  methods: {
    wordbtn: function wordbtn(index, item) {
      if (!this.showSeed.includes(index)) {
        this.showSeed.push(index);
        this.showSeed1.push(item);
      } else {
        this.showSeed.splice(this.showSeed.findIndex(function (i) {
          return i === index;
        }), 1);
        this.showSeed1.splice(this.showSeed1.findIndex(function (i) {
          return i === item;
        }), 1);
      }

      this.seedIndex[index] = !this.seedIndex[index];
    },
    confirm: function confirm() {
      if (this.seedWord == this.showSeed1.toString()) {
        if (this.$store.state.loginType === "send") {
          this.$router.replace({
            path: "/home/shift",
            query: this.$route.query
          });
        } else {
          this.$router.replace({
            path: "/home"
          });
        }
      } else {
        // alert("You should click word in order");
        this.checkPromp = "You should click word in order.";
      }
    }
  },
  created: function created() {
    this.seedWord = this.$store.state.seed.split(" ");
  }
};
